import React from 'react';

import './AdvBlock.css';


class AdvBlock extends React.Component{
    render(){
        return(
            <div className="advertisement_long">
                <a href="https://yandex.ru/"> <h1>Это просто копия оригинальной страницы Yandexa.</h1> </a>
            </div>
        )
    }
}

 export default AdvBlock;
